-- ----------------------------
-- View structure for v_schedule_reminder
-- ----------------------------
DROP VIEW IF EXISTS `v_schedule_reminder`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_schedule_reminder` AS select 
`schedule`.* ,
DATE_ADD(date_finish, INTERVAL reminder_service-1 MONTH) as date_reminder
from 
`schedule` 
where 
status='selesai'
and
reminder_service > 0 ;

-- ----------------------------
-- View structure for v_schedule_user
-- ----------------------------
DROP VIEW IF EXISTS `v_schedule_user`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `v_schedule_user` AS select `schedule`.* , schedule_user.id_user , customers.`code` as customer_code ,customers.`name` as customer_name , users.`name` as user_name ,
users.indentity_number as indentity_number 
from 
`schedule`
LEFT JOIN customers
ON `schedule`.id_customer = customers.id
LEFT JOIN schedule_user
ON `schedule`.id = schedule_user.id_schedule 
LEFT JOIN users
ON schedule_user.id_user=users.id ;

SET FOREIGN_KEY_CHECKS = 1;
